query getMultiPartShutter($moduleId: Int!, $applicableSection: String!, $dimension: String, $cityId: Int!, $categoryId: Int, $subCategoryId: Int) {
  getMultiPartShutter(moduleId: $moduleId, applicableSection: $applicableSection, dimension: $dimension, cityId: $cityId, categoryId: $categoryId, subCategoryId: $subCategoryId) {
    shutterId
    name
    description
    modelId
    imageUrl
    category
    __typename
  }
}
